define({"topics" : [{"title":"Configuring LDAP Authentication","shortdesc":"\n               <p class=\"shortdesc\">If your organization uses LDAP and you want multiple users to access <span class=\"ph\">Data Collector</span>, you         can configure <span class=\"ph\">Data Collector</span> to use         LDAP authentication. After you configure LDAP authentication, users log in to <span class=\"ph\">Data Collector</span> using         their LDAP username and password. \n               </p>\n            ","href":"datacollector\/UserGuide\/Configuration\/Authentication.html#concept_x2j_5ts_g5","attributes": {"data-id":"concept_x2j_5ts_g5",},"menu": {"hasChildren":true,},"tocID":"concept_x2j_5ts_g5-d46e16652","next":"concept_x2j_5ts_g5-d46e16652",},{"title":"Configuring File-Based Authentication","shortdesc":"\n               <p class=\"shortdesc\">If your organization does not use LDAP and you want to enable multiple users to         access <span class=\"ph\">Data Collector</span>,         you might configure <span class=\"ph\">Data Collector</span> to use         file-based authentication. \n               </p>\n            ","href":"datacollector\/UserGuide\/Configuration\/Authentication.html#concept_wgy_rxt_5x","attributes": {"data-id":"concept_wgy_rxt_5x",},"menu": {"hasChildren":true,},"tocID":"concept_wgy_rxt_5x-d46e17159","next":"concept_wgy_rxt_5x-d46e17159",}]});